import React from "react";
import { Outlet } from "react-router";
import styled from "styled-components";
// import CommonTask from "../feature/task/component/commontask/CommonTask";
import OtherTask from "../feature/task/component/OtherTack/OtherTack";
import Task from "../feature/task/Task";
// import EditTasks from "../feature/task/component/EditTask/EditTask";
import Header from "./header/header";
import Sidebar from "./sidebar/Sidebar";
// import Content from './content/conten'

const MainContent = styled.div`
  display: flex;
  /* background: #000; */
`;
const Layout = () => {
  return (
    <div>
      <Header></Header>
      <MainContent>
        <Sidebar />
        <Outlet />
      </MainContent>
    </div>
  );
};

export default Layout;
